function heart() {
	c=document.getElementById("myCanvas");
	ctx=c.getContext("2d");
	c.width = window.innerWidth;
	c.height = window.innerHeight - 80;
	ctx.clearRect(0, 0, c.width, c.height);
	//first heart drowing
	ctx.fillStyle="#ff0000";
	ctx.strokeStyle = "#ff5200";
    ctx.strokeWeight = 1;
    ctx.shadowOffsetX = 4.0;
    ctx.shadowOffsetY = 4.0;
    ctx.lineWidth = 3.0; 
    ctx.moveTo(k, k + d / 4);
    ctx.quadraticCurveTo(k, k, k + d / 4, k);
    ctx.quadraticCurveTo(k + d / 2, k, k + d / 2, k + d / 4);
    ctx.quadraticCurveTo(k + d / 2, k, k + d * 3/4, k);
    ctx.quadraticCurveTo(k + d, k, k + d, k + d / 4);
    ctx.quadraticCurveTo(k + d, k + d / 2, k + d * 3/4, k + d * 3/4);
    ctx.lineTo(k + d / 2, k + d);
    ctx.lineTo(k + d / 4, k + d * 3/4);
    ctx.quadraticCurveTo(k, k + d / 2, k, k + d / 4);
	//secend heart drow	
    ctx.moveTo(k+26, k + d / 4);
    ctx.quadraticCurveTo(k+26, k, k+26 + d / 4, k);
    ctx.quadraticCurveTo(k+26 + d / 2, k, k+26 + d / 2, k + d / 4);
    ctx.quadraticCurveTo(k+26 + d / 2, k, k+26 + d * 3/4, k);
    ctx.quadraticCurveTo(k+26 + d, k, k+26 + d, k + d / 4);
    ctx.quadraticCurveTo(k+26 + d, k + d / 2, k+26 + d * 3/4, k + d * 3/4);
    ctx.lineTo(k+26 + d / 2, k + d);
    ctx.lineTo(k+26 + d / 4, k + d * 3/4);
    ctx.quadraticCurveTo(k+26, k + d / 2, k+26, k + d / 4);
	//3 heart	
    ctx.moveTo(k+54, k + d / 4);
    ctx.quadraticCurveTo(k+54, k, k+54 + d / 4, k);
    ctx.quadraticCurveTo(k+54 + d / 2, k, k+54 + d / 2, k + d / 4);
    ctx.quadraticCurveTo(k+54 + d / 2, k, k+54 + d * 3/4, k);
    ctx.quadraticCurveTo(k+54 + d, k, k+54 + d, k + d / 4);
    ctx.quadraticCurveTo(k+54 + d, k + d / 2, k+54 + d * 3/4, k + d * 3/4);
    ctx.lineTo(k+54 + d / 2, k + d);
    ctx.lineTo(k+54 + d / 4, k + d * 3/4);
    ctx.quadraticCurveTo(k+54, k + d / 2, k+54, k + d / 4);
    ctx.stroke();
	ctx.fill();                    

}
